package viewer.layers.knd;

import AUR.util.knd.AURAreaGraph;
import AUR.util.knd.AURWorldGraph;
import adf.agent.info.WorldInfo;
import java.awt.BasicStroke;
import java.awt.Color;
import java.awt.Graphics2D;
import java.awt.image.BufferedImage;
import java.io.ByteArrayInputStream;
import javax.imageio.ImageIO;
import rescuecore2.standard.entities.Human;
import rescuecore2.standard.entities.StandardEntity;
import rescuecore2.standard.entities.StandardEntityURN;
import sun.misc.BASE64Decoder;
import viewer.K_ScreenTransform;
import viewer.K_ViewerLayer;

/**
 *
 * @author Alireza Kandeh - 2018
 */

public class K_AgentsLayer extends K_ViewerLayer {

	
	private static BufferedImage decodeToImage(String imageString) {
		BufferedImage image = null;
		byte[] imageByte;
		try {
			BASE64Decoder decoder = new BASE64Decoder();
			imageByte = decoder.decodeBuffer(imageString);
			ByteArrayInputStream bis = new ByteArrayInputStream(imageByte);
			image = ImageIO.read(bis);
			bis.close();
		} catch (Exception e) {
			e.printStackTrace();
		}
		return image;
	}


	public static BufferedImage PF = decodeToImage("");
	public static BufferedImage AT = decodeToImage("");
	public static BufferedImage FB = decodeToImage("");

	@Override
	public void paint(Graphics2D g2, K_ScreenTransform kst, AURWorldGraph wsg, AURAreaGraph selected_ag) {
		
		int r = 16;
		WorldInfo wi = wsg.wi;
		g2.setStroke(new BasicStroke(1));
		for (StandardEntity e : wi.getAllEntities()) {
			if (e instanceof Human == false) {
				continue;
			}
			Human h = (Human) e;
			if (h.isXDefined() == false || h.isYDefined() == false) {
				continue;
			}
			if(h.getStandardURN().equals(StandardEntityURN.FIRE_BRIGADE)) {
				g2.drawImage(FB, kst.xToScreen(h.getX()) - r, kst.yToScreen(h.getY()) - r, 2 * r, 2 * r, null);
			} else if(h.getStandardURN().equals(StandardEntityURN.POLICE_FORCE)) {
				g2.drawImage(PF, kst.xToScreen(h.getX()) - r, kst.yToScreen(h.getY()) - r, 2 * r, 2 * r, null);
				
			} else if(h.getStandardURN().equals(StandardEntityURN.AMBULANCE_TEAM)) {
				g2.drawImage(AT, kst.xToScreen(h.getX()) - r, kst.yToScreen(h.getY()) - r, 2 * r, 2 * r, null);
				g2.setColor(Color.white);
			}

		}
	}

}